import React from 'react';
import './item-list.css'
import SwapiService from '../../services/SwapiService.js'

class Items extends Comment {
  render() {
    return (
    <div>
      <ul className='list-group'>
        <li className="list-group-item"></li>
        <li className="list-group-item"></li>
        <li className="list-group-item"></li>
        <li className="list-group-item"></li>
        <li className="list-group-item"></li>
        <li className="list-group-item"></li>
      </ul>

    </div>
    )
  }

};


export default Items
